from typing import List
class Solution:
    def uniquePathsWithObstacles(self, obstacleGrid: List[List[int]]) -> int:
        # Dynamic Programming - 2D array
        rows = len(obstacleGrid)
        cols = len(obstacleGrid[0])
        if obstacleGrid[0][0] == 1 or obstacleGrid[rows-1][cols-1] == 1:
            return 0
        self.paths = [[0 for _ in range(cols)] for _ in range(rows)]
        # Set up the obstacles in self.path
        for r in range(rows):
            for c in range(cols):
                if obstacleGrid[r][c] == 1:
                    self.paths[r][c] = None
        # Fill up the bottom row
        for c in range(cols-1, -1, -1):
            if obstacleGrid[rows-1][c] != 1:
                self.paths[rows-1][c] = 1
            else:
                self.paths[rows-1][c] = 0
        # Fill up the rightmost column
        for r in range(rows-2, -1, -1):
            if obstacleGrid[r][cols-1] != 1:
                self.paths[r][cols-1] = 1
            else:
                self.paths[r][cols-1] = 0
        # Now fill up the rest of the grid bottom-to-top right-to-left
        for r in range(rows-2, -1, -1):
            for c in range(cols-2, -1, -1):
                if obstacleGrid[r][c] == 1:
                    self.paths[r][c] = 0
                else:
                    self.paths[r][c] = self.paths[r][c+1] + self.paths[r+1][c]
        return self.paths[0][0]

